import { AppBar, Toolbar,styled } from '@mui/material'
import React from 'react'

const StyledHeader = styled(AppBar)`
background: #2774f0;
height:55px
`
const Header = () => {
  return (
    <StyledHeader>
        <Toolbar>

        </Toolbar>
    </StyledHeader>
    )
}

export default Header
